// MapSize.jsx
import React, { useState } from 'react';
import './MapSize.css';
import PropertyCard from './PropertyCard';
import { Map2GIS } from './Map2GIS';
import { testProperty } from './testProperty'; // если вынесем отдельно

function MapSize() {
  const [selectedProperty, setSelectedProperty] = useState(null);

  return (
    <div className="container">
      <div className="text">
        <h1>Привет, мир!</h1>
        <p>Это базовый функциональный компонент на JSX.</p>
      </div>

      <div className="map" style={{ height: '400px' }}>
        <Map2GIS property={selectedProperty} />
      </div>

      <PropertyCard 
        property={testProperty} 
        onClick={() => setSelectedProperty(testProperty)}
      />
    </div>
  );
}

export default MapSize;
